import React from 'react';
import { BiHome } from "react-icons/bi";
import { Nav, Navbar } from 'react-bootstrap';
import MUIDataTable from "mui-datatables";

function PartnerUserSeach(){

    const columns = [
        {
         name: "name",
         label: "Name",
         options: {
          filter: true,
          sort: true,
         }
        },
        {
         name: "company",
         label: "Company",
         options: {
          filter: true,
          sort: false,
         }
        },
        {
         name: "city",
         label: "City",
         options: {
          filter: true,
          sort: false,
         }
        },
        {
         name: "state",
         label: "State",
         options: {
          filter: true,
          sort: false,
         }
        },
       ];
       
       const data = [
        { name: "Joe James", company: "Test Corp", city: "Yonkers", state: "NY" },
        { name: "John Walsh", company: "Test Corp", city: "Hartford", state: "CT" },
        { name: "Bob Herm", company: "Test Corp", city: "Tampa", state: "FL" },
        { name: "James Houston", company: "Test Corp", city: "Dallas", state: "TX" },
       ];
       
       const options = {
         filterType: 'checkbox',
       };

    return(
        <div>
        <Navbar bg="dark" variant="dark">
            <Nav.Link href="./Partner">
                <div className="image_icon_nav">
                    <BiHome />
                </div>
            </Nav.Link>
            <Nav className="me-auto">
                <Nav.Link href="./PartnerJobAd">Job Ad</Nav.Link>
                <Nav.Link href="./PartnerUserSearch">Search user</Nav.Link>
                <Nav.Link href="./PartnerStats">Statics</Nav.Link>
            </Nav>
            <Navbar.Collapse className="justify-content-end">
                <Navbar.Text>
                    Signed in as: <a href="./PartnerProfile">NicholasLow</a>
                </Navbar.Text>
            </Navbar.Collapse>
        </Navbar>

        <div>
            
            <MUIDataTable
  title={<h1>Application List</h1>}
  data={data}
  columns={columns}
  options={options}
/>

        </div>
    </div>
    );
}

  
export default PartnerUserSeach;
